                            >
                                <EditIcon />
                            </IconButton>
                            <IconButton
                                aria-label='delete'
                                onClick={() => excluir(dado.id)}
                            >
                                <DeleteIcon />
                            </IconButton>
                            </Stack> }
                        </td>
                        </tr>
                    ))}
                    </tbody> */}
                </table>{' '}
                </div>
            </div>
            </div>
        </Card>
        </div>
    );
}
export default ListagemUsuarios;
